import React from "react";
import reactDom from "react-dom";
import Card from "./Heading";
import "./index.css";
import sdata from './sdata';
reactDom.render(
<>
{/* <h2>These are top 5 netflix series</h2><br></br> */}

<Card 
imgsrc={sdata[0].imgsrc}
sname = {sdata[0].sname}
title = {sdata[0].title}
link={sdata[0].link}
/>
<Card 
imgsrc={sdata[1].imgsrc}
sname = {sdata[1].sname}
title = {sdata[1].title}
link={sdata[1].link}
/>
<Card 
imgsrc={sdata[2].imgsrc}
sname = {sdata[2].sname}
title = {sdata[2].title}
link={sdata[2].link}
/>
<Card 
imgsrc={sdata[3].imgsrc}
sname = {sdata[3].sname}
title = {sdata[3].title}
link={sdata[3].link}
/>

<Card 
imgsrc={sdata[0].imgsrc}
sname = {sdata[1].sname}
title = {sdata[2].title}
link={sdata[3].link}
/>
</>,
document.getElementById("root")
)
